import React, { Component } from 'react';
import { robots } from './robots';
import CardList from './CardList';
import SearchBox from './SearchBox';

const App = () => {
	return (
		<React.Fragment className="tc">
			<h1>RoboFriends</h1>
			<SearchBox />
			<CardList robots={robots} />
		</React.Fragment>
	);
}

export default App;
